function Get-DXWebcamVideo
{
  <#
  .SYNOPSIS
  This function utilizes the DirectX and DShowNET assemblies to record video from the host's webcam.

  Author: Chris Ross (@xorrior)
  License: BSD 3-Clause

  .DESCRIPTION
  This function will capture video output from the hosts webcamera. It will by default choose the first available devices.
  Compression can be specified by naming pattern and the first compression method matching that pattern will be used. 

  .PARAMETER RecordTime
  Amount of time to record in seconds. It takes 1-2 seconds for the video to open. Defaults to 5.

  .PARAMETER Path
  File path to save the recorded output. Defaults to the current users APPDATA directory. The output format is in AVI. 

  .PARAMETER VideoInputIndex
  The index of the input device to use. To find this, you can use Get-DXVideoInput. Default = 0 (first device)

  .PARAMETER AudioInputIndex
  The index of the input device to use. To find this, you can use Get-DXAudioInput. Default = 0 (first device)

  .PARAMETER VideoCompressorPattern
  The pattern to use to find the name of the preferred video compressor. Default uses: DV Video Encoder 

  .PARAMETER AudioCompressorPattern
  The pattern to use to find the name of the preferred audio compressor. Default uses: GSM 6.10

  .PARAMETER FrameRate
  The frame rate to use when capturing video. Default = 7

  .EXAMPLE

  Get-DXWebcamVideo

  Record the webcam for 5 seconds and save the output to the current users APPDATA directory. Use the default compression and framerate. 

  .EXAMPLE

  Get-DXWebcamVideo -RecordTime 10 -Path C:\webcam.avi -FrameRate 4

  Record 10 seconds of footage with a decreased frame rate (smaller size) to c:\webcam.avi

  #>
  [CmdletBinding()]
  param
  (
    [Parameter( Position = 0, Mandatory = $True)]
    [ValidateNotNullOrEmpty()]
    [int]$RecordTime,

    [Parameter( Position = 1, Mandatory = $False)]
    [ValidateScript({$(Split-Path $_ | Test-Path) -and -Not $(Test-Path $_)})]
    [Alias("FilePath")]
    [string]$Path = "$($env:APPDATA)\out.avi",

    [Parameter( Position = 2, Mandatory = $False)]
    [int]$VideoInputIndex = 0,

    [Parameter( Position = 3, Mandatory = $False)]
    [int]$AudioInputIndex = 0,

    [Parameter( Position = 4, Mandatory = $False)]
    [string]$VideoCompressorPattern = "*DV*",

    [Parameter( Position = 5, Mandatory = $False)]
    [string]$AudioCompressorPattern = "*GSM*",

    [Parameter( Position = 6, Mandatory = $False)]
    [int]$FrameRate = 7
  )



    #Set the input devices
    Write-Verbose "[+] Setting input devices"
    $VideoInput = $(Get-DXVideoInput)[$VideoInputIndex]
    Write-Verbose "[+] Selected the Video device $($VideoInput.Name)"
    $AudioInput = $(Get-DXAudioInput)[$AudioInputIndex]
    Write-Verbose "[+] Selected the Audio device $($Audio.Name)"

    if (($VideoInput -eq $null) -or ($AudioInput -eq $null))
    {
        Throw "Input devices failed to get set"
    }

    Write-Verbose "[+] Building capture object with filename $Path"
    #Define the VideoCapture object and set the output path for the file
    $VideoCapture = New-Object DirectX.Capture.Capture -ArgumentList $VideoInput,$AudioInput
    $VideoCapture.Filename = $Path

    #Attempt to set compression with known filters
    $VidCompression = $filters.VideoCompressors | ?{$_.Name -like $VideoCompressorPattern} | Select -First 1
    Write-Verbose "[+] Selected the Video compression $($VidCompression.Name)"
    $AudCompression = $filters.AudioCompressors | ?{$_.Name -like $AudioCompressorPattern} | Select -First 1
    Write-Verbose "[+] Selected the Audio compression $($AudCompression.Name)"
    if (($VidCompression -eq $Null) -or ($AudCompression -eq $Null))
    {
        Throw "Setting compression failed"
    }

    Write-Verbose "[+] Setting Compression"
    $VideoCapture.VideoCompressor = $VidCompression
    $VideoCapture.AudioCompressor = $AudCompression

    #Set the framerate to help control size
    $VideoCapture.FrameRate = $FrameRate
    Write-Verbose "[+] Framerate Set to $FrameRate"

    #Start the video capture
    Write-Verbose "[+] Starting Webcam video capture"
    try
    {
        $VideoCapture.Start()
    }
    catch [Exception]
    {
        $VideoCapture.Stop()
        Throw $_
    }
    
    #Pause while the recording goes
    Write-Verbose "[+] Capture Started. Sleeping $Recordtime Seconds..."
    Start-Sleep -seconds $RecordTime

    $VideoCapture.stop()

    Write-Verbose "[+] Webcam video capture completed"

    Write-Output $(Get-ChildItem -Path $Path)
}

